import React from 'react';
import SlickDemo from './component/SlickDemo';
const Home = () => {
  return (
    <div className="body-layout">
      <h1>Welcome to GeeksforGeeks</h1>
      
    </div>

  );
};
function App() {  
  return (  
    <div className="App">  
    <SlickDemo/>  
    </div>  
  );  
}  
export default Home;
